import './App.scss';
import { Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import Home from './components/Home';


function App() {
  return (

     <Routes>
        <Route path='/' element={<Layout />} >
        <Route index element={<Home />} />
        <Route path='about' element={<Layout />} ></Route>
        </Route>
      </Routes>      

  )
}

export default App;
